import './main.css';
import VertiBar from './modules/navigation';
import MainPage from './modules/Views/mainPage';
import {Route, Routes} from 'react-router-dom';

function App(){
    return (
        <div>
            <table id="layout">
                <tr>
                    <td id="sidebar">
                        <VertiBar />
                    </td>
                    <td id="mbody">
                        <Routes>
                            <Route element={<MainPage />} />
                            <Route path="/letter" element={<MainPage />} />
                            <Route path="/resume" element={<MainPage />} />
                            <Route path="/contact" element={<MainPage />}/>
                            <Route path="/showcase" element={<MainPage />}/>
                        </Routes>
                    </td>
                </tr>
            </table>
        </div>
    );
}

export default App;
